  }
  .freud-tag-warning .p-tag {
    border: 1px solid $feedback-color-warning-pure;
    color: $feedback-color-warning-pure;
  }
  .freud-tag-error .p-tag {
    border: 1px solid $feedback-color-negative-04;
    color: $feedback-color-negative-04;
  }
}

